import React from 'react';
import { Link } from 'react-router-dom';
import './NotionCupPreview.css';

const NotionCupPreview: React.FC = () => {
  return (
    <section className="notion-cup-banner">
      <div className="cup-rect">
        <div className="cup-left">
          <h2 className="notion-title">NOTION CUP</h2>
          <h3 className="notion-subtitle">JACK &amp; JILL COMPETITION</h3>
          <p className="notion-desc">
            Experience one of the best dance competitions in Dubai, UAE.
          </p>
          <Link to="/notion-cup" className="notion-cta">
            Register Now!
          </Link>
        </div>
        <div className="cup-right">
          {/* Replace src with your actual badge image */}
          <img
            src="/images/notion-cup-badge.png"
            alt="Notion Cup Emblem"
            className="notion-badge"
            draggable={false}
          />
        </div>
      </div>
    </section>
  );
};

export default NotionCupPreview;
